import {Component, OnInit} from '@angular/core';
import {Account} from "../../../model/Account";

@Component({
  selector: 'app-user-dash-board',
  templateUrl: './userDashBoardView.html',
  styleUrls: ['./userDashBoardView.css']
})
export class UserDashBoardView implements OnInit
{
    user:Account = new Account();
    ngOnInit(): void
    {
      // @ts-ignore
      this.user = JSON.parse( window.sessionStorage.getItem('MCQuser') );
      if(this.user == null)
      {
        this.user = new Account();
      }
    }

    toMyTest()
    {
      window.location.href = "/user/myTest";
    }

    toMyAwards()
    {
      window.location.href = "user/myAwards";
    }

}
<div class="container mt-4">
  <div class="row text-center pt-4">
    <h4 class="titleUnderLine">DashBoard</h4>
  </div>
  <div class="row mt-5 mb-5">
    <div class="col-6">
      <div class="row justify-content-center text-center">
        <div class="dashboardCard2" (click)="toMyTest()">
          <div class="row">
            <div class="col-4 text-end">
              <span class="logoCard"><i class="bi bi-pencil-square"></i></span>
            </div>
            <div class="col-8 text-start">
              <div class="h1 mt-5"> My Test </div>
            </div>
          </div>
        </div>
      </div>
    </div>
    <div class="col-6">
        <div class="row justify-content-center text-center">
          <div class="dashboardCard1"  (click)="toMyAwards()">
            <div class="row">
              <div class="col-4 text-end">
                <span class="logoCard"><i class="bi bi-award"></i></span>
              </div>
              <div class="col-8 text-start">
                <div class="h1 mt-5"> My Awards </div>
              </div>
            </div>
          </div>
        </div>
    </div>
  </div>
</div>
